import React from "react";
import { useSelector } from "react-redux";
import { incNum, decNum } from "./action";

const App = () => {

    const  num = useSelector(state => state.Number);

    return(
        <>
            <button>+</button>
            <input type="text" value={num}/>
            <button>-</button>

        </>
    )
}

export default App;
